import styled from 'styled-components';

export default function Login (props) {
    return(
        <div>
            <Background>
            <Container>
                <h1>Login</h1>
            </Container>
            </Background>
        </div>
    );
}

const Container = styled.div`
    background-color:red;
`
function Background () {
    return(
        <div>
            <img src="login/login-bg.svg"></img>
        </div>
    );
}
